import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Routes,Route} from 'react-route-dom'
import ShowHotel from './Components/ShowHotel';

function App() {
  return (
    <div className='App'>
      <BrowserRouter>
      <Routes>
        <Route path='/' element={ <ShowHotel/>}/>
        <Route path='/' element={ <ShowHotel/>}/>
        <Route path='/' element={ <ShowHotel/>}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
